import * as React from 'react';
import cn from './Empty.module.scss';

export interface EmtpyProps {
  /**
   * Id for testing
   */
  testId?: string;
}

export function Empty(props: EmtpyProps): JSX.Element {
  const testId = `${props.testId}_option_empty`;
  return (
    <li data-testid={testId} className={cn.empty}>
      No data
    </li>
  );
}
